import { Link } from 'react-router-dom';

const NavBar = () => {
    const { currentUser } = useContext(UserContext)
    return (
        <nav className='NavBar'>
            <div className='container-sm'>
                <Link className='navbar-brand'>
                    Login
                </Link>
                <Link className='navbar-brand'>
                    Register
                </Link>
            </div>
        </nav>
    )
}

export default NavBar;
